import React from 'react'
import Todo from './Todo'

const TodoList = ({ todos, handleDelete }) => {
    return (
        <div>
            <ul>
                {todos.map((todo) => (
                    <Todo
                        key={todo.id}
                        handleDelete={handleDelete}
                        todo={todo}
                    />
                ))}
            </ul>
        </div>
    )
}

export default TodoList
